import React from "react";
import "./style-post.css"


const PostItem = (props) => {
    console.log(props)

    return (
        <div className="post">
            <div className="post_content">
                <strong> {props.post.title} </strong>
                <div>
                    {props.post.body}
                </div>
            </div>
            <div className="post_btn">
                <button> Delete </button>
            </div>
        </div>
    )
};

export default PostItem;
